%\[text] Step 1: Create Trapezoidal Velocity Trajectories
clear;
close all;
clc;

%% (1a) Build geometric SMILEY path in the xâ€“y plane

% Overall size of the face
R_face   = 0.12;   % radius of outer circle (face)

% Eye geometry
eye_r    = 0.02;
eye_y    = 0.03;
eye_xoff = 0.05;   % left/right offset of eye centers

xcL = -eye_xoff;  ycL = eye_y;   % left eye center
xcR =  eye_xoff;  ycR = eye_y;   % right eye center

% Nose line (vertical)
nose_top_y =  0.03;
nose_bot_y = -0.03;

% Smile arc (part of a circle)
smile_cy = -0.005;     % vertical center of smile
smile_R  = 0.06;       % smile radius
phi1 = deg2rad(210);   % left end of smile
phi2 = deg2rad(330);   % right end of smile

% Resolution for each segment
n_outer  = 800;   % outer circle
n_eye    = 200;   % each eye
n_line   = 150;   % nose
n_smile  = 400;   % smile
n_trans  = 80;    % transitions between features

xPath = [];
yPath = [];
ledPath = [];

% ---- 1) Outer circle (LED ON) ----
phi = linspace(-pi/2, 3*pi/2, n_outer);  % start at bottom of face
x_outer = R_face * cos(phi);
y_outer = R_face * sin(phi);

xPath   = [xPath, x_outer];
yPath   = [yPath, y_outer];
ledPath = [ledPath, ones(1, n_outer)];   % LED ON

% ---- 2) Transition to left eye start (LED OFF) ----
% start of left eye circle at its bottom point
xL_start = xcL + eye_r*cos(-pi/2);
yL_start = ycL + eye_r*sin(-pi/2);

x0 = x_outer(end);
y0 = y_outer(end);

s = linspace(0,1,n_trans);
x_trans = (1-s)*x0 + s*xL_start;
y_trans = (1-s)*y0 + s*yL_start;

xPath   = [xPath, x_trans];
yPath   = [yPath, y_trans];
ledPath = [ledPath, zeros(1, n_trans)];  % LED OFF

% ---- 3) Left eye circle (LED ON) ----
phi_eye = linspace(-pi/2, 3*pi/2, n_eye);
x_eyeL = xcL + eye_r*cos(phi_eye);
y_eyeL = ycL + eye_r*sin(phi_eye);

xPath   = [xPath, x_eyeL];
yPath   = [yPath, y_eyeL];
ledPath = [ledPath, ones(1, n_eye)];     % LED ON

% ---- 4) Transition to right eye start (LED OFF) ----
xR_start = xcR + eye_r*cos(-pi/2);
yR_start = ycR + eye_r*sin(-pi/2);

x0 = x_eyeL(end);
y0 = y_eyeL(end);

x_trans = (1-s)*x0 + s*xR_start;
y_trans = (1-s)*y0 + s*yR_start;

xPath   = [xPath, x_trans];
yPath   = [yPath, y_trans];
ledPath = [ledPath, zeros(1, n_trans)];  % LED OFF

% ---- 5) Right eye circle (LED ON) ----
x_eyeR = xcR + eye_r*cos(phi_eye);
y_eyeR = ycR + eye_r*sin(phi_eye);

xPath   = [xPath, x_eyeR];
yPath   = [yPath, y_eyeR];
ledPath = [ledPath, ones(1, n_eye)];     % LED ON

% ---- 6) Transition to nose top (LED OFF) ----
x_nose_top = 0;
y_nose_top = nose_top_y;

x0 = x_eyeR(end);
y0 = y_eyeR(end);

s = linspace(0,1,n_trans);
x_trans = (1-s)*x0 + s*x_nose_top;
y_trans = (1-s)*y0 + s*y_nose_top;

xPath   = [xPath, x_trans];
yPath   = [yPath, y_trans];
ledPath = [ledPath, zeros(1, n_trans)];  % LED OFF

% ---- 7) Nose vertical line (LED ON) ----
s = linspace(0,1,n_line);
x_nose = zeros(1,n_line) + x_nose_top;
y_nose = (1-s)*nose_top_y + s*nose_bot_y;

xPath   = [xPath, x_nose];
yPath   = [yPath, y_nose];
ledPath = [ledPath, ones(1, n_line)];    % LED ON

% ---- 8) Transition to smile start (LED OFF) ----
x_smile_start = smile_R*cos(phi1);
y_smile_start = smile_cy + smile_R*sin(phi1);

x0 = x_nose(end);
y0 = y_nose(end);

s = linspace(0,1,n_trans);
x_trans = (1-s)*x0 + s*x_smile_start;
y_trans = (1-s)*y0 + s*y_smile_start;

xPath   = [xPath, x_trans];
yPath   = [yPath, y_trans];
ledPath = [ledPath, zeros(1, n_trans)];  % LED OFF

% ---- 9) Smile arc (LED ON) ----
phi_smile = linspace(phi1, phi2, n_smile);
x_smile = smile_R*cos(phi_smile);
y_smile = smile_cy + smile_R*sin(phi_smile);

xPath   = [xPath, x_smile];
yPath   = [yPath, y_smile];
ledPath = [ledPath, ones(1, n_smile)];   % LED ON

% Convert to column vectors
xPath   = xPath(:);
yPath   = yPath(:);
ledPath = ledPath(:);

% Remove duplicate consecutive points so interp1 has unique samples
ds_temp = sqrt(diff(xPath).^2 + diff(yPath).^2);
mask = [true; ds_temp > 1e-8];
xPath   = xPath(mask);
yPath   = yPath(mask);
ledPath = ledPath(mask);

% Cumulative arc length (THIS is now called sSamples)
ds       = sqrt(diff(xPath).^2 + diff(yPath).^2);
sSamples = [0; cumsum(ds)];   % arc-length coordinate
d        = sSamples(end);     % total path length

%% (1b) Trapezoidal speed along arc length

tfinal = 11;                  % total time
dt = 0.002;                   % 2 ms step
t = 0:dt:tfinal;
N = length(t);

% average speed
c = d / tfinal;

% normalized trapezoidal profile g(t)
g = @(t, T, ta) (T/(T-ta))*((t < ta) .* (t / ta) + ...
                            (t >= ta & t <= (T - ta)) .* 1 + ...
                            (t > (T - ta)) .* ((T - t) / ta));

ta = tfinal/4;
gt = g(t, tfinal, ta);

% Forward-Euler integration of arc length s(t)
s_traj = zeros(size(t));
for i = 1:N-1
    s_traj(i+1) = s_traj(i) + dt * c * gt(i);
end

% Plot of s(t)
figure; %[output:64c4ebe5]
plot(t, s_traj, 'LineWidth', 2); %[output:64c4ebe5]
title('Path Parameter s(t)'); %[output:64c4ebe5]
grid on; %[output:64c4ebe5]
xlabel('time (s)'); %[output:64c4ebe5]
ylabel('s(t) (m)'); %[output:64c4ebe5]
yline(d,'w--','LineWidth',2); %[output:64c4ebe5]
legend('s(t)','total length','Location','southeast'); %[output:64c4ebe5]

%% (1c) Get x(t), y(t) and check speed

x = interp1(sSamples, xPath, s_traj, 'linear');
y = interp1(sSamples, yPath, s_traj, 'linear');

% speed magnitude
v = sqrt(diff(x).^2 + diff(y).^2) / dt;

figure; %[output:2aa2794c]
plot(t(1:end-1), v, 'LineWidth', 3); hold on; %[output:2aa2794c]
yline(c,'w--','LineWidth',1.5);       % average speed %[output:2aa2794c]
yline(0.5,'r--','LineWidth',1.5);     % 0.5 m/s limit %[output:2aa2794c]
hold off; %[output:2aa2794c]
title('Trajectory Velocity'); %[output:2aa2794c]
grid on; %[output:2aa2794c]
xlabel('time (s)'); %[output:2aa2794c]
ylabel('velocity (m/s)'); %[output:2aa2794c]
legend('speed','average speed','0.5 m/s limit','Location','south'); %[output:2aa2794c]

%% Step 2: Forward Kinematics

L1 = 0.2435;
L2 = 0.2132;
W1 = 0.1311;
W2 = 0.0921;
H1 = 0.1519;
H2 = 0.0854;

% home position of end effector
M = [-1 0 0 L1+L2;
      0 0 1 W1+W2;
      0 1 0 H1-H2;
      0 0 0 1];

% space screw axes
S1 = [0 0 1 0 0 0]';
S2 = [0 1 0 -H1 0 0]';
S3 = [0 1 0 -H1 0 L1]';
S4 = [0 1 0 -H1 0 L1+L2]';
S5 = [0 0 -1 -W1 L1+L2 0]';
S6 = [0 1 0 H2-H1 0 L1+L2]';
S  = [S1 S2 S3 S4 S5 S6];

% body screw axes
B1 = ECE569_Adjoint(M)\S1;
B2 = ECE569_Adjoint(M)\S2;
B3 = ECE569_Adjoint(M)\S3;
B4 = ECE569_Adjoint(M)\S4;
B5 = ECE569_Adjoint(M)\S5;
B6 = ECE569_Adjoint(M)\S6;
B  = [B1 B2 B3 B4 B5 B6];

% joint angles (given home configuration)
theta0 = [-1.6800   -1.4018   -1.8127   -2.9937   -0.8857   -0.0696]';

% quick FK check (optional)
T0_space = ECE569_FKinSpace(M,S,theta0);
T0_body  = ECE569_FKinBody(M,B,theta0);
T0_space - T0_body;  %#ok<NOPTS>
T0 = T0_body;

% Desired Tsd(t) = T0 * Td(t)  (smiley drawn in {b} plane)
Tsd = zeros(4,4,N);
Rd = eye(3);
for i = 1:N
    pd = [x(i); y(i); 0];
    Td = [Rd, pd;
          0 0 0 1];
    Tsd(:,:,i) = T0 * Td;
end

% Plot trajectory in {s} frame
xs = Tsd(1,4,:);
ys = Tsd(2,4,:);
zs = Tsd(3,4,:);
figure; %[output:8f97b088]
plot3(xs(:), ys(:), zs(:), 'LineWidth', 1); %[output:8f97b088]
title('Smiley Trajectory in \{s\} frame'); %[output:8f97b088]
xlabel('x (m)'); %[output:8f97b088]
ylabel('y (m)'); %[output:8f97b088]
zlabel('z (m)'); %[output:8f97b088]
hold on; %[output:8f97b088]
plot3(xs(1),ys(1),zs(1),'go','MarkerSize',10,'LineWidth',2); %[output:8f97b088]
plot3(xs(end),ys(end),zs(end),'rx','MarkerSize',10,'LineWidth',2); %[output:8f97b088]
legend('Trajectory','Start','End'); %[output:8f97b088]
grid on; %[output:8f97b088]
hold off; %[output:8f97b088]

%% Step 3: Inverse Kinematics

thetaAll = zeros(6,N);

% Solve IK for FIRST desired pose using theta0 as initial guess
[theta_first, success] = ECE569_IKinBody(B, M, Tsd(:,:,1), theta0, 1e-6, 1e-6);
if (~success)
    error('Error. Could not perform IK at index %d.',1);
end
thetaAll(:,1) = theta_first;

% March forward in time, using previous solution as initial guess
f = waitbar(0,['Inverse Kinematics (1/',num2str(N),') complete.']);

for i = 2:N
    initialguess = thetaAll(:, i-1);
    [thetaSol, success] = ECE569_IKinBody(B, M, Tsd(:,:,i), initialguess, 1e-6, 1e-6);
    if (~success)
        close(f);
        error('Error. Could not perform IK at index %d.',i);
    end
    thetaAll(:,i) = thetaSol;
    waitbar(i/N,f,['Inverse Kinematics (',num2str(i),'/',num2str(N),') complete.']);
end
close(f);

% (3c) First-order differences of joint angles
dj = diff(thetaAll');          % (N-1) x 6
figure; %[output:290ee291]
plot(t(1:end-1), dj, 'LineWidth', 1); %[output:290ee291]
title('First Order Difference in Joint Angles'); %[output:290ee291]
legend('J1','J2','J3','J4','J5','J6','Location','northeastoutside'); %[output:290ee291]
grid on; %[output:290ee291]
xlabel('time (s)'); %[output:290ee291]
ylabel('first order difference'); %[output:290ee291]

% (3d) Verify FK of thetaAll reproduces trajectory
actualTsd = zeros(4,4,N);
for i = 1:N
    actualTsd(:,:,i) = ECE569_FKinBody(M, B, thetaAll(:, i));
end

xs = actualTsd(1,4,:);
ys = actualTsd(2,4,:);
zs = actualTsd(3,4,:);
figure; %[output:93092b22]
plot3(xs(:), ys(:), zs(:), 'LineWidth', 1); %[output:93092b22]
title('Verified Smiley Trajectory in \{s\} frame'); %[output:93092b22]
xlabel('x (m)'); %[output:93092b22]
ylabel('y (m)'); %[output:93092b22]
zlabel('z (m)'); %[output:93092b22]
hold on; %[output:93092b22]
plot3(xs(1),ys(1),zs(1),'go','MarkerSize',10,'LineWidth',2); %[output:93092b22]
plot3(xs(end),ys(end),zs(end),'rx','MarkerSize',10,'LineWidth',2); %[output:93092b22]
legend('Trajectory','Start','End'); %[output:93092b22]
grid on; %[output:93092b22]
hold off; %[output:93092b22]

% (3e) Determinant of body Jacobian (manipulability)
body_dets = zeros(N,1);
for i = 1:N
    Jb = ECE569_JacobianBody(B, thetaAll(:, i));
    body_dets(i) = det(Jb);
end
figure; %[output:042c85b0]
plot(t, body_dets, 'LineWidth', 1.5); %[output:042c85b0]
title('Manipulability'); %[output:042c85b0]
grid on; %[output:042c85b0]
xlabel('time (s)'); %[output:042c85b0]
ylabel('det(J_B)'); %[output:042c85b0]

%% (3f) Save to CSV File
% LED on for: outer circle, both eyes, nose, smile.
% LED off for transitions.

led = interp1(sSamples, ledPath, s_traj, 'previous');  % piecewise-constant LED(t)
led = double(led(:) > 0.5);                           % clean 0/1

data = [t' thetaAll' led(:)];

% TODO: change filename to your own Purdue ID
writematrix(data, '0039367426_bonus.csv');


